import React, {Component} from 'react';

class Product extends Component{
    render() {
        return(
            <div>
                <Cart />
            </div>
        );
    }
}

class Cart extends Component {
    constructor(props){
        super(props);
        this.state = {qty: 0}
    }


    componentDidMount(){
        console.log("Execute after component render");
    }
    render() {
        return(
            <div>
                <h2>Cart Items</h2>
            </div>
        );
    }
}

export default Product;
